import React from "react";

const Portfolio = () => {
  return (
    <div className='portfolio-container'>

      <div className='portfolio-vid'>
          <h1>Video Test</h1>
      </div>

      <div className='portfolio-vid-syn'>
          <h1>Video Synopsis Test</h1>
      </div>

      <div className='portfolio-cards'>
          <h1>Card Test</h1>
      </div>

    </div>
  )
};

export default Portfolio;
